import React from "react";
import TopBanner from "../../components/TopBanner";
import MuiThemeProvider from '@material-ui/core/styles/MuiThemeProvider';
import { TextField } from "@material-ui/core";
import Grid from '@material-ui/core/Grid';

const ReachOut = () => {
return (
    <>
        <TopBanner />
        <MuiThemeProvider>
            <div style = {{margin: "50px auto", maxWidth: "500px"}}>
                <Grid container direction={"column"} spacing={5}>
                        <TextField label = "FirstName" placeholder = "Please enter your first name." fullWidth = "true" />

                        <TextField label = "LastName" placeholder = "Please enter your last name." fullWidth = "true" />

                        <TextField label = "Email" placeholder = "Please enter your email ID." fullWidth = "true" />

                        <TextField label = "Message" placeholder = "I'd love to hear from you!" fullWidth = "true" />
                </Grid>
            </div>
            
        </MuiThemeProvider>
    </>
)
};

    export default ReachOut;
